import React, {Component} from "react";

class Consumer extends Component{
    componentDidMount() {
        let response = fetch("https://www.wikidata.org/w/api.php");
        console.log(response);
    }
    render() {
        return(
            <div>
                <p>We are trying to contact wikidata</p>
            </div>
        )
    }
}
export default Consumer;
